import React, {useState} from "react";
import MenuBar from "../components/MenuBar"



function App() {
    const [data, setData] = useState({});
    fetch('/data')
    .then(res => res.json())
    .then(data => setData(data), () => {
        console.log('data read: ', data);
    })

    return (
        <>
            <MenuBar></MenuBar>
            {data.lastname} 안녕 {data.firstname}
        </>
    );
}

export default App;
